import "./App.css";
import Title from "./Title";
import Field from "./Field";

function App() {
    return (
        <div>
            <Title title="Create account" />
            <Field fieldTitle="Name" inputType="text" />
            <Field fieldTitle="Email" inputType="email" />
            <Field fieldTitle="Password" inputType="password" />
            <Field fieldTitle="Confirm your password" inputType="password" />
            <input type="submit" />
        </div>
    );
}

export default App;
